import React, { useState } from 'react'
import './index.css'
import './App.css';

const App = () => {
  const[name,setName]=useState("");
  const[gmail,setGmail]=useState("");
  const[contact,setContact]=useState("");
  const[password,setPassword]=useState("");
  return (
    <div className='App'>
      <form className='loginform'>
      <h1 className='title'>Welcome to Royal Login Page!!</h1>
      <label className='name'>Enter Your Name: </label>
      <input type={"name"} className="textArea" onClick={(e)=>setName(e.target.value)}></input><br></br><br></br>
      <label className='gmail'>Enter Your Gmail: </label>
      <input type={"gmail"} className="gmailArea"></input><br></br><br></br>
      <label className='Contact'>Enter Your Contact Number: </label>
      <input type={"number"} className="contactArea"></input><br></br><br></br>
      <label className='Password'>Enter Your Password: </label>
      <input type={"password"} className="passArea"></input><br></br><br></br>
      <button className='but'>Submit</button>
      </form>
    </div>
  )
}

export default App
